import React from "react";

const PokemonList = ({ type }) => {
    return (
        <div className="residentsList container">
        {type.data?.map((data) => (
            <PokemonInfo url={data.data.url} key={data.data.url} />
        ))}
        </div>
    );
};

export default PokemonList;
